webpackJsonp([0x8de4d86ac3a7],{"./node_modules/json-loader/index.js!./.cache/json/little-girls.json":function(A,e){A.exports={data:{site:{siteMetadata:{title:"Саентология Тома Круза",author:"Том Круз"}},markdownRemark:{id:"/home/gleki/ccc/src/pages/little-girls/index.md absPath of file >>> MarkdownRemark",html:'<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/4ebb4142e908e6cd24b241eedf3958a9-3f0b4.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 87.8048780487805%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="поцелуй"\n        title=""\n        src="/static/4ebb4142e908e6cd24b241eedf3958a9-f8fb9.jpg"\n        srcset="/static/4ebb4142e908e6cd24b241eedf3958a9-e8976.jpg 148w,\n/static/4ebb4142e908e6cd24b241eedf3958a9-63df2.jpg 295w,\n/static/4ebb4142e908e6cd24b241eedf3958a9-f8fb9.jpg 590w,\n/static/4ebb4142e908e6cd24b241eedf3958a9-3f0b4.jpg 820w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>9 мая 1950 года 66 лет назад  Хаббард опубликовал свой опус, среди измышлений которого есть и такое:</p>\n<blockquote>\n<p>Существует две аксиомы о функционировании ума, с которыми одитор должен быть знаком…\nПервая аксиома представляет интерес для одитора в его работе потому, что с ней он может четко установить, имеет ли он дело с рациональной реакцией или нет.</p>\n<p><strong>Семилетняя девочка</strong>, которую бросает в дрожь, <strong>когда ее целует мужчина</strong>, ничего не рассчитывает; она реагирует на инграмму, так как в семь лет она не должна была бы видеть ничего плохого в поцелуе, даже страстном. Наверняка существует раннее происшествие, возможно пренатальное, которое сделало мужчин или поцелуи очень плохими.</p>\n</blockquote>\n<p>Чта? Семилетняя девочка, которой не нравится, когда её страстно целует взрослый мужчина, должна быть умственно больна?</p>\n<p>Для справки оригинальный текст:</p>\n<blockquote>\n<p>There are two axioms about mind function with which the auditor should be familiar… The first axiom is of interest to the auditor in his work because with it he can clearly establish whether or not he is confronting a rational reaction.\nThe seven-year-old girl who shudders because a man kisses her is not computing; she is reacting to an engram since at seven she should see nothing wrong in a kiss, not even a passionate one. There must have been an earlier experience, possibly prenatal, which made men or kissing very bad.</p>\n</blockquote>',frontmatter:{title:"Он целовал 7-летних девочек",date:"2016-04-20"}}},pathContext:{path:"/little-girls/"}}}});
